$(".submit").click(function() {
let age =  Number($(".age").val());
let color = $(".color").val();
    
    if(age <= 16&&age >= 16||color ==="Red"||color==="red"||color==="RED"){
        $(".output").text("Mario");
      $(".character").attr("src","data:image/jpeg;base64,");
   
    } else if (age <= 16&&age >= 16||color ==="Green"||color==="green"||color==="GREEN"){ 
        $(".output").text("Luigi");
    $(".character").attr("src","data:image/jpeg;base64,");
    } else if (age <= 16&&age >= 16||color ==="Yellow"||color==="yellow"||color==="YELLOW"){
        $(".output").text("Wario");
    $(".character").attr("src","data:image/jpeg;base64,");
    } else  if (age <= 16&&age >= 16||color ==="Purple"||color==="purple"||color==="PURPLE"){
        $(".output").text("Waluigi");
     $(".character").attr("src","data:image/jpeg;base64,");
    }
    
});